import './ExpenseDate.css';

function ExpenseDate(props){
    const year = props.date.getFullYear();
    const month = props.date.toLocaleString('em-US', { month: 'long'});
    const date = props.date.toLocaleString('em-US', { day: '2-digit'});
    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{date}</div>
        </div>
    );
}
